-- Sequence and defined type
CREATE SEQUENCE IF NOT EXISTS radolan_data_id_seq;

-- Table Definition
CREATE TABLE "public"."radolan_data" (
    "id" int4 NOT NULL DEFAULT nextval('radolan_data_id_seq'::regclass),
    "measured_at" timestamp,
    "value" int2,
    "geom_id" int2,
    PRIMARY KEY ("id")
);

